window.bookSummaryJSON = "<p>People say Eva’s a little ditzy, when they want to be nice. Truth is, she’s a magnet for trouble and she wouldn’t know what caution looks like if she bumped into it. </p> <p>But even she knows the delicious hunk she meets at the club is dangerous; he might have saved her once, but he could as easily destroy her and no one could do a thing about it. His kind is above reproach, above the laws, above humanity. </p> <p>She should stay away. </p> <p>She won’t. </p> <p>After thousands upon thousands of years, seeing empires rise and fall, Zarken is indifferent to everything, and entirely focused on his work. </p> <p>Until her.</p>"; 
